// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract MyToken{
    address userAddr;
    uint result;
    address[] public addrList;
    mapping(address => uint) wallet;

    constructor(){
        userAddr;
        addrList;
        wallet;
        result = 10;
    }

    function start() public{
        userAddr = msg.sender;
        result = 100;
    }

    function depositWallet(address clientAddr, uint deposit) public{
			for (uint i = 0; i < addrList.length; i++){
				if (addrList[i] == clientAddr){
					wallet[clientAddr] += deposit;
				} else {
					createWallet(clientAddr, deposit);
				}
			}
		}

		function createWallet(address clientAddr, uint deposit) public{
			addrList.push(clientAddr);
			wallet[clientAddr] = deposit;
		}

		function getBalance(address clientAddr) public view returns(uint){
				return wallet[clientAddr];
		}

    function sumResult(uint sum) public returns(uint){
        for (uint i = 1; i <= sum; i++){
            result += i;
        }
        return result;
    }

    function minusResult(uint inputValue) public returns(uint){
        result -= inputValue;
        return result;
    }

    function getAddress() public view returns(address){
        return userAddr;
    }

    function getResult() public view returns(uint){
        return result;
    }

    function transfer(uint amt) public {
        if (result >= amt) {
            result -= amt;
        }
    }

}

